import React from 'react';
import './PricingPlans.css';
import logo from '../assets/turo.png'; // Update path as per your folder

const plans = [
  {
    title: 'Free Plan',
    price: '$0',
    features: ['Limited API Calls', 'Community Support', 'GitHub Aura once/week'],
  },
  {
    title: 'Pro Plan',
    price: '$15',
    features: ['Unlimited API', 'Priority Chatbot Support', 'Daily GitHub Aura'],
  },
  {
    title: 'Enterprise',
    price: '$49',
    features: ['Custom APIs', 'Dedicated Slack Channel', 'Team GitHub Reports'],
  }
];

const PricingPlans = () => {
  return (
    <div className="pricing-page">
      <div className="join-header">
        Join Turo <img src={logo} alt="Turo" />
      </div>

      <div className="scroll-wrapper">
        <div className="scroll-background">Choose Your Plan</div>
        <div className="pricing-scroll">
          {plans.map((plan, index) => (
            <div className="pricing-card" key={index}>
              <div className="card-content">
                <div className="title-card">
                  <div className="title">{plan.title}</div>
                  <div className="plain"><span>{plan.price}</span></div>
                </div>
                <button className="card-btn">Choose Plan</button>
                <div className="card-separate">
                  <div className="separate"></div>
                  <span>features</span>
                  <div className="separate"></div>
                </div>
                <div className="card-list-features">
                  {plan.features.map((feature, i) => (
                    <div className="option" key={i}>â€¢ {feature}</div>
                  ))}
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default PricingPlans;
